import React from "react";

class BackNext extends React.Component {
  render() {
    return (
      <div className="flex pt-10 justify-between">
        <button className="bg-white hover:bg-gray-100 text-gray-800 font-semibold py-2 px-4 border border-gray-400 rounded shadow" onClick={()=>this.props.BackNext(-1)}>Back</button>
        <button className="w-16 bg-white mx-10" onClick={()=>this.props.BackNext(1)}></button>
        <button className="bg-white hover:bg-gray-100 text-gray-800 font-semibold py-2 px-4 border border-gray-400 rounded shadow">
        Next
</button>
      </div>
    );
  }
}
export default BackNext;
